INSERT INTO `qb_reply` VALUES ('737','','0','704','52','1','0','<p>&nbsp;&nbsp;&nbsp;&nbsp;双列圆柱滚子轴承有圆柱形内孔和圆锥形内孔（轴承后置代号加K）两种结构。该类轴承具有结构紧凑、刚性大、承载能力大、受负荷后变形小等优点，特别适用于机床主轴支承。圆锥形内孔还可以起到微量调整游隙的作用，且可以简化定位装置结构，方便安装拆卸。</p><p><a href=\"http://www.sbi.com.cn/userfiles/NN.JPG\" target=\"_blank\"><img style=\"width:160px;float:none;height:258px\" border=\"0\" hspace=\"0\" src=\"http://www.sbi.com.cn/userfiles/NN.JPG\" width=\"160\" height=\"258\" /></a><a href=\"http://www.sbi.com.cn/userfiles/NNU.JPG\" target=\"_blank\"><img style=\"width:160px;float:none;height:250px\" border=\"0\" hspace=\"0\" src=\"http://www.sbi.com.cn/userfiles/NNU.JPG\" width=\"160\" height=\"250\" /></a></p><table style=\"width:580px;border-collapse:collapse\" width=\"580\" height=\"608\"><colgroup><col width=\"79\" /><col width=\"60\" /><col width=\"30\" /><col width=\"31\" /><col width=\"25\" /><col width=\"30\" /><col width=\"42\" /><col width=\"39\" /><col width=\"41\" /><col width=\"52\" /><col width=\"65\" /><col width=\"86\" /><tbody><tr height=\"19\"><td style=\"border-bottom:#c0c0c0 3px solid;text-align:center;border-left:#c0c0c0 3px solid;font-style:normal;width:79px;background:#ffffff;height:38px;color:#000000;font-size:13px;vertical-align:middle;border-top:#c0c0c0 3px solid;font-weight:700;border-right:#c0c0c0 3px solid\" class=\"et3\" height=\"38\" rowspan=\"2\" width=\"79\">型号</td><td style=\"border-bottom:#c0c0c0 3px solid;text-align:center;border-left:#c0c0c0 3px solid;font-style:normal;width:60px;background:#ffffff;height:38px;color:#000000;font-size:13px;vertical-align:middle;border-top:#c0c0c0 3px solid;font-weight:700;border-right:#c0c0c0 3px solid\" class=\"et3\" height=\"38\" rowspan=\"2\" width=\"60\">原代号</td><td style=\"text-align:center;font-style:normal;width:146px;background:#ffffff;height:19px;color:#000000;font-size:13px;vertical-align:middle;border-top:#c0c0c0 2px solid;font-weight:700;border-right:#c0c0c0 2px solid\" class=\"et4\" height=\"19\" width=\"146\" colspan=\"5\">外